import React from "react";
import { Input, Button, Modal } from "antd";

export const SeachBar = (props) => {
  showModal = () => {
    this.setState({
      visible: true,
    });
  };

  handleOk = (e) => {
    console.log(e);
    this.setState({
      visible: false,
    });
  };

  handleCancel = (e) => {
    console.log(e);
    this.setState({
      visible: false,
    });
  };
  return (
    <div style={{ padding: 30, margin: 15 }}>
      <Input
        onChange={props.handleChange}
        onPressEnter={props.handleSubmit}
        onSearch={props.handleSubmit}
        size="large"
        type="text"
      />
      <Button type="primary" onClick={this.showModal}>
        Open Modal
      </Button>
      <Modal
        title="Basic Modal"
        visible={this.state.visible}
        onOk={this.handleOk}
        onCancel={this.handleCancel}
      >
        <p>Some contents...</p>
        <p>Some contents...</p>
        <p>Some contents...</p>
      </Modal>
    </div>
  );
};
